import React from "react";
import DeleteItemButton from "./DeleteItemButton/DeleteItemButton";
import "./Item.css";
import Aux from "../Aux/Aux";

const Item = props => {
  return (
    <Aux>
      <div className="item">
        Item id: {props.id}
        <br />
        Item code: {props.code}
        <DeleteItemButton deleteItem={props.deleteItem} />
      </div>
    </Aux>
  );
};

export default Item;
